-- ----------------------------
--  Table structure for `activity`
-- ----------------------------
DROP TABLE IF EXISTS `activity`;
CREATE TABLE `activity` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '类型',
  `org_id` int(11) NOT NULL DEFAULT '0' COMMENT '所属机构',
  `admin_id` int(11) NOT NULL DEFAULT '0' COMMENT '管理员',
  `active` tinyint(4) NOT NULL DEFAULT '0' COMMENT '状态 0.未启用 1.启用 9. 禁用',
  `name` varchar(255) DEFAULT NULL,
  `title` varchar(255) DEFAULT NULL,
  `description` varchar(255) DEFAULT NULL,
  `content` text,
  `cover_pic` varchar(255) DEFAULT NULL COMMENT '封面图片',
  `start_time` int(11) DEFAULT '0',
  `end_time` int(11) DEFAULT '0',
  `is_apply` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否报名 0.没有报名 1.报名',
  `apply_start_time` int(11) DEFAULT NULL COMMENT '报名开始时间',
  `apply_end_time` int(11) DEFAULT NULL COMMENT '报名结束时间',
  `is_sign` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否签到 0.不签到 1.签到',
  `sign_type` tinyint(4) DEFAULT '0' COMMENT '0.无 1.所有人可签到 2.报名者可签到',
  `sign_start_time` int(11) DEFAULT NULL COMMENT '签到开始时间',
  `sign_end_time` int(11) DEFAULT NULL COMMENT '签到结束时间',
  `visit_num` int(11) NOT NULL DEFAULT '0',
  `created_at` int(11) DEFAULT NULL,
  `updated_at` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COMMENT='活动表';

