BEGIN;
INSERT INTO `article` VALUES ('1', '0', '1', '1', '0', '中华医学会第十四次全国白血病·淋巴瘤学术会议', '中华医学会第十四次全国白血病·淋巴瘤学术会议', '描述1111', '<p style=\"text-align: center;\"><br/></p><p style=\"text-align: center;\"><img src=\"http://7n.medsci.cn/uploads/ueditor/php/upload/image/20170818/1503043458806450.png\" title=\"1503043458806450.png\" alt=\"image.png\" width=\"600\" height=\"130\"/></p><p><br/></p><p style=\"line-height: 1.75em;\">&nbsp; &nbsp; &nbsp;中华医学会第十四次全国白血病·淋巴瘤学术会议于2017年7月13日-7月15日在哈尔滨市举办。会议由中华医学会、中华医学会血液学分会主办，哈尔滨血液病肿瘤研究所、中国医学科学院血液病医院、北京大学血液病研究所、苏州大学附属第一医院血研所、北京白求恩公益基金会协办。有来自国内外著名学者就白血病及淋巴瘤、骨髓瘤等领域相关基础及临床做专题报告；美国、欧洲、日本等学者对白血病、淋巴瘤、骨髓瘤、造血干细胞移植、MDS及MPN进行了专题研讨；分为白血病、淋巴瘤、骨髓瘤、恶性血液病的免疫治疗、造血干细胞移植、MDS及MPN等专场进行学术论文交流。</p><p style=\"line-height: 1.75em;\">&nbsp; &nbsp; &nbsp; &nbsp;中华医学会王大方副秘书长致辞时表示，此次会议将对白血病和淋巴瘤的临床热点及难点进行全方位、深层次和多角度讨论，为进一步提高我国血液病防治水平做出新的更大贡献，为改善全民健康水平发挥了极其重大的作用。</p><p style=\"line-height: 1.75em;\"><br/></p><p style=\"line-height: 1.75em;\"><br/></p><p style=\"font-size: 14px; line-height: normal;\"><strong><span style=\"font-size: 16px;\"></span></strong></p><p style=\"white-space: normal; font-size: 14px; line-height: normal; text-align: center;\"><span style=\"font-size: 16px;\"><strong>如需了解更多淋巴瘤的前沿信息<span style=\"line-height: normal;\">&nbsp;</span>请扫描二维码访问<span style=\"line-height: normal;\">“</span>淋巴瘤亿刻<span style=\"line-height: normal;\">”</span>网站。</strong></span></p><p style=\"white-space: normal; text-align: center;\"><img src=\"http://image.135editor.com/files/users/286/2865052/201708/VzeRSUnA_kKgB.png\" alt=\"WechatIMG1466.png\"/></p><p><br/></p>', null, '3', '1506243480', '1510186945'), ('2', '0', '1', '1', '0', '2017天津How I Treat和淋巴瘤转化医学国际研讨会', '2017天津How I Treat和淋巴瘤转化医学国际研讨会', '描述2', '<p style=\"white-space: normal; text-align: center; line-height: 1.75em;\"><br/></p><p style=\"white-space: normal; line-height: 1.75em;\"><img src=\"http://image.135editor.com/files/users/162/1625396/201708/GbPeBZPf_xSp9.png\" alt=\"15018096601201.png\"/></p><p style=\"white-space: normal; line-height: 1.75em;\">&nbsp; &nbsp; &nbsp;</p><p style=\"white-space: normal; line-height: 1.75em; text-indent: 2em;\">2017年8月19~20日，由天津市抗癌协会淋巴瘤专业委员会、天津市抗衰老学会主办，天津医科大学肿瘤医院、中美淋巴血液肿瘤诊治中心和《中国肿瘤临床》与《Cancer Biology &amp; Medicine》杂志社共同承办的2017天津How I Treat和淋巴瘤转化医学国际研讨会将在天津凯悦酒店隆重举行。</p><p style=\"white-space: normal; line-height: 1.75em; text-indent: 2em;\">刚刚结束不久的Lugano国际淋巴瘤大会(ICML)，美国临床肿瘤学大会（ASCO），欧洲血液学协会年会(EHA)等国际著名学术会议上淋巴瘤的研究成果层出不穷，本届会议以“为淋巴瘤医师提供兼具专业性和实用性的基础及临床科研前沿”为宗旨，围绕淋巴瘤的&quot;How I Treat&quot;和转化医学两个主题进行学术报告和讨论，分享国内外淋巴瘤诊治的新进展、新理念、新方法。</p><p style=\"white-space: normal; line-height: 1.75em; text-indent: 0em;\"><strong style=\"text-indent: 2em;\"><br/></strong></p><p style=\"white-space: normal; line-height: 1.75em; text-indent: 0em;\"><strong>大会主席：张会来教授，孟斌教授</strong></p><p style=\"white-space: normal; line-height: 1.75em; text-indent: 0em;\"><strong>会议时间：8月19~20日</strong></p><p style=\"white-space: normal; line-height: 1.75em; text-indent: 0em;\"><strong>会议地点：天津凯悦酒店</strong></p><p style=\"white-space: normal; line-height: 1.75em; text-indent: 0em;\"><strong>会议日程：</strong></p><p style=\"white-space: normal; line-height: 1.75em; text-align: center;\"><img src=\"http://7n.medsci.cn/uploads/ueditor/php/upload/image/20170818/1503059029858553.jpeg\" title=\"1503059029858553.jpeg\" alt=\"天津11.jpg\"/><br/></p><p style=\"font-size: 13px; line-height: normal;\"><strong><span style=\"color: rgb(85, 85, 85);\"></span></strong></p><p style=\"font-size: 14px; line-height: normal;\"><span style=\"font-size: 16px;\"><strong><br/></strong></span></p><p style=\"font-size: 14px; line-height: normal;\"><span style=\"font-size: 16px;\"><strong><br/></strong></span></p><p style=\"font-size: 14px; line-height: normal; text-align: center;\"><span style=\"font-size: 16px;\"><strong>如需了解更多淋巴瘤的前沿信息<span style=\"line-height: normal;\"> </span>请扫描二维码访问<span style=\"line-height: normal;\">“</span>淋巴瘤亿刻<span style=\"line-height: normal;\">”</span>网站。</strong></span></p><p style=\"text-align: center;\"><img src=\"http://image.135editor.com/files/users/286/2865052/201708/VzeRSUnA_kKgB.png\" alt=\"WechatIMG1466.png\"/></p><p style=\"white-space: normal; line-height: 1.75em;\"><br/></p>', 'org/1/unique/cover_article_a20042.jpg', '29', '1506243626', '1512147735'), ('3', '0', '1', '1', '0', '文章3', '文章3的标题', '描述3', '<p><img src=\"http://res.cdn.bioon.com/application/live/cover_picture/2017/09/21/c5785df23d91993bf40486ba55710ca4.jpg\"/></p>', null, '0', '1506243697', '1506526136'), ('4', '0', '2', '2', '0', '文章1', '文章1', '描述1', '<p>文章1详情</p><p>1</p><p>2</p><p>3</p><p>4</p><p>5</p><p>6</p>', null, '0', '1506340164', '1508390971'), ('5', '0', '1', '1', '9', '文章4', '文章4', '描述4', '<p>这是内容详情</p><p>1</p><p>2</p><p>3</p><p>4</p><p>5</p><p>6</p>', null, '1', '1507745817', '1510023291'), ('12', '0', '1', '1', '0', '1', null, null, null, 'org/1/unique/articles/cover_article_7a0301fc.jpg', '0', '1512186988', '1512186988');
COMMIT;

