INSERT INTO `product` VALUES ('3', '0', '1', '1', '0', '3', '产品3', '产品3', '说明3', '<p>产品3</p><p>1</p><p>2</p><p>3</p><p>4</p><p>5</p><p>6</p>', null, '7', '1505919537', '1510128599'), ('8', '0', '1', '1', '9', '3', '伊布替尼', '伊布替尼', '描述8', '<h3 style=\"margin: 20px 0px 0px; padding: 0px; font-weight: 400; font-size: 16px; max-width: 100%; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; white-space: normal; line-height: 30px; color: rgb(34, 34, 34); background-color: rgb(255, 255, 255); box-sizing: border-box !important; word-wrap: break-word !important;\"></h3><p style=\"margin-top: 0px; padding: 0px 0px 20px; max-width: 100%; clear: both; min-height: 1em; margin-bottom: 5px; box-sizing: border-box !important; word-wrap: break-word !important;\">2017年8月24日，全球首个口服BTK抑制剂亿珂®（伊布替尼）正式获得中国食品药品监督管理总局（CFDA）批准，用于治疗慢性淋巴细胞白血病及套细胞淋巴瘤患者。亿珂®（伊布替尼）曾四次被FDA授予突破性药物认定，获得国际奖项“盖伦奖”，截止目前全球85个国家获批超过65000名患者受益，未来将开启中国B细胞淋巴瘤治疗的新纪元！&nbsp;<br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 20px; max-width: 100%; clear: both; min-height: 1em; box-sizing: border-box !important; word-wrap: break-word !important;\"><img src=\"http://7n.medsci.cn/uploads/ueditor/php/upload/image/20170901/1504236204664320.jpeg\" title=\"1504236204664320.jpeg\" alt=\"WechatIMG1165.jpeg\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 20px; max-width: 100%; clear: both; min-height: 1em; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(0, 0, 255);\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-weight: bold;\">BTK抑制剂的发现发展之旅-新型靶向药物的诞生</span>&nbsp;</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 20px; max-width: 100%; clear: both; min-height: 1em; box-sizing: border-box !important; word-wrap: break-word !important;\">据报道，1999年合成了首个BTK抑制剂LFM-A13，但是遗憾的是，随后LFM-A13并未开展临床研究，不过在了解BTK抑制作用的机理下，美国塞莱拉基因公司药物化学教研室学者继续展开研究，最终合成了compound 4，并用两种方法证实了这类药物与BTK结合的不可逆性，ibrutinib就此诞生。&nbsp;</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 20px; max-width: 100%; clear: both; min-height: 1em; box-sizing: border-box !important; word-wrap: break-word !important;\">而后动物及人体外研究均提示PCI-32765与BTK活化位点不可逆结合，可获得满意疗效。2013年《J Clin Oncol》杂志公布了一项令人激动人心的结果，56例RR B细胞淋巴瘤或CLL患者接受口服ibrutinib升阶梯治疗，ibrutinib与BTK的cys481不可逆结合至少24h。患者OR率为60%，CR为16%4。因此，2013年开始获得FDA加速审批：2013.11MCL，2014.7CLL，2015.1WM,同时欧洲药物机构也批准了这些B细胞恶性肿瘤的药物治疗。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 20px; max-width: 100%; clear: both; min-height: 1em; box-sizing: border-box !important; word-wrap: break-word !important;\">2012年发表于Blood的一项研究阐释了伊布替尼的作用机制：PCI-32765通过抑制BTK，抑制肿瘤细胞生存和增殖，抑制BCR调控的粘附，调节趋化因子调控的粘附和迁移。同时合理阐释了CLL患者接受伊布替尼治疗后出现的临床应答：可获得快速且持续的淋巴结病变缓解，伴随暂时停药后可逆的一过性淋巴细胞增多。&nbsp;</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 20px; max-width: 100%; clear: both; min-height: 1em; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-weight: bold; color: rgb(0, 0, 255);\">CLL/SLL和MCL疗效上历史性的突破</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 20px; max-width: 100%; clear: both; min-height: 1em; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-weight: bold;\">PCYC-1102/03研究</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 20px; max-width: 100%; clear: both; min-height: 1em; box-sizing: border-box !important; word-wrap: break-word !important;\">2013年首次发布在新英格兰医学杂志，纳入了101例R/R CLL患者，研究共随访5年发现，伊布替尼单药治疗患者ORR为89%，中位PFS为52个月，中位OS未达到，5年OS为57%。突破现有免疫化疗方案治疗RR CLL后PFS不到2年的局限。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 20px; max-width: 100%; clear: both; min-height: 1em; box-sizing: border-box !important; word-wrap: break-word !important;\"><img src=\"http://7n.medsci.cn/uploads/ueditor/php/upload/image/20170831/1504161387631525.png\" title=\"1504161387631525.png\" alt=\"图片 1.png\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 20px; max-width: 100%; clear: both; min-height: 1em; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-weight: bold;\">MCL-3001&nbsp;RAY研究</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 20px; max-width: 100%; clear: both; min-height: 1em; box-sizing: border-box !important; word-wrap: break-word !important;\">发表Lancet杂志的一项伊布替尼研究，纳入了280例R/R&nbsp;MCL患者，随访3年，结果显示，伊布替尼单药治疗ORR为72%，中位PFS为15.6个月，中位OS为30.3个月。并且首次复发后使用，PFS可延长至25.4个月, OS 延长至42.1个月;&nbsp;</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 20px; max-width: 100%; clear: both; min-height: 1em; box-sizing: border-box !important; word-wrap: break-word !important;\">&nbsp;<img src=\"http://7n.medsci.cn/uploads/ueditor/php/upload/image/20170831/1504161397949063.png\" title=\"1504161397949063.png\" alt=\"图片 2.png\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 20px; max-width: 100%; clear: both; min-height: 1em; box-sizing: border-box !important; word-wrap: break-word !important;\"><img src=\"http://7n.medsci.cn/uploads/ueditor/php/upload/image/20170831/1504161406723950.png\" title=\"1504161406723950.png\" alt=\"图片 3png.png\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 20px; max-width: 100%; clear: both; min-height: 1em; box-sizing: border-box !important; word-wrap: break-word !important;\"><img src=\"http://7n.medsci.cn/uploads/ueditor/php/upload/image/20170831/1504161414739757.png\" title=\"1504161414739757.png\" alt=\"图片 4.png\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 20px; max-width: 100%; clear: both; min-height: 1em; box-sizing: border-box !important; word-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 20px; max-width: 100%; clear: both; min-height: 1em; box-sizing: border-box !important; word-wrap: break-word !important;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 20px; max-width: 100%; clear: both; min-height: 1em; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-weight: bold; color: rgb(0, 0, 255);\">可靠的安全性</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 20px; max-width: 100%; clear: both; min-height: 1em; box-sizing: border-box !important; word-wrap: break-word !important;\">在中国发起的以CLL/SLL亚洲患者为主的CLL 3002国际多中心Ⅲ期研究报告显示：伊布替尼对比利妥昔单抗显著提高ORR,中位随访18个月，伊布替尼PFS 74% vs 利妥昔单抗&nbsp;PFS 11.9%,OS 伊布替尼&nbsp;vs 利妥昔单抗79.8% vs57.6%，在显著提高PFS与OS的同时，伊布替尼治疗不良事件多为1或2级，3，4级非常罕见，无剂量相关性，每日一次的口服治疗也给患者带来了更好的生活质量。&nbsp;</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 20px; max-width: 100%; clear: both; min-height: 1em; box-sizing: border-box !important; word-wrap: break-word !important;\">相信亿珂®（伊布替尼）在中国获批定会为淋巴瘤患者带来全新的治疗选择与更高的生活质量，推动中国淋巴瘤治疗领域水平的提高。</p><p style=\"margin-top: 15px; margin-bottom: 15px; color: rgb(85, 85, 85); font-size: 14px; line-height: normal; white-space: normal;\"><span style=\"font-size: 16px;\"><strong><br/></strong></span></p><p style=\"margin-top: 15px; margin-bottom: 15px; color: rgb(85, 85, 85); font-size: 14px; line-height: normal; white-space: normal; text-align: center;\"><span style=\"font-size: 16px;\"><strong>如需了解更多淋巴瘤的前沿信息<span style=\"line-height: normal;\">&nbsp;</span>请扫描二维码访问<span style=\"line-height: normal;\">“</span>淋巴瘤亿刻<span style=\"line-height: normal;\">”</span>网站。</strong></span></p><p style=\"text-align: center;\"><span style=\"font-size: 16px;\"><strong><img src=\"http://7n.medsci.cn/uploads/ueditor/php/upload/image/20170915/1505452618242518.png\" title=\"1505452618242518.png\" alt=\"淋巴瘤亿刻二维码.png\"/></strong></span></p>', null, '36', '1506225562', '1511410494'), ('9', '0', '2', '2', '0', '7', '产品1', '产品1', '描述1', '<p>产品1详情</p><p>1</p><p>2</p><p>3</p><p>4</p><p>5</p><p>6</p>', null, '0', '1506339300', '1508390839'), ('10', '0', '1', '1', '0', '0', '1', '1', '1', null, 'org/1/unique/products/cover_product_3a0303c6.jpg', '0', '1512188264', '1512188264');
COMMIT;

